import react from "react";
import { useState } from "react";
import { 
  HomeIcon, 
  ChartBarIcon, 
  CogIcon, 
  UsersIcon, 
  BellIcon, 
  LogoutIcon, 
  ChevronLeftIcon, 
  ChevronRightIcon 
} from "@heroicons/react/solid";

export default function DashboardLayout() {
  const [active, setActive] = useState("Dashboard");
  const [collapsed, setCollapsed] = useState(false);

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <aside className={`bg-gray-800 text-white flex flex-col p-4 transition-all duration-300 relative ${collapsed ? "w-20" : "w-64"}`}>
        {/* Toggle Button */}
        <button 
          className="absolute top-4 right-4 p-2 bg-red-600 text-white rounded-full hover:bg-red-700 transition"
          onClick={() => setCollapsed(!collapsed)}
        >
          {collapsed ? <ChevronRightIcon className="w-6 h-6" /> : <ChevronLeftIcon className="w-6 h-6" />}
        </button>

        {/* Logo */}
        <div className="flex items-center justify-center mb-8">
          <img 
            src="/images/tupseal.png" 
            alt="Tupseal" 
            className={`transition-all duration-300 ${collapsed ? "w-10 h-10" : "w-32 h-32"}`} 
          />
        </div>

        {/* Navigation */}
        <nav className="flex flex-col space-y-2">
          {[ 
            { name: "Dashboard", icon: HomeIcon },
            { name: "Usage Monitor", icon: ChartBarIcon },
            { name: "Janitors", icon: UsersIcon },
            { name: "Resources", icon: CogIcon },
            { name: "Settings", icon: CogIcon },
            { name: "Users", icon: UsersIcon },
          ].map((item) => (
            <button
              key={item.name}
              className={`flex items-center p-3 rounded-lg transition ${
                active === item.name ? "bg-gray-700" : "hover:bg-gray-600"
              }`}
              onClick={() => setActive(item.name)}
            >
              <item.icon className={`w-6 h-6 ${collapsed ? "mx-auto" : "mr-3"}`} />
              {!collapsed && <span>{item.name}</span>}
            </button>
          ))}
        </nav>

        {/* Logout */}
        <button className="mt-auto flex items-center p-3 rounded-lg hover:bg-red-700 transition">
          <LogoutIcon className={`w-6 h-6 ${collapsed ? "mx-auto" : "mr-3"}`} />
          {!collapsed && "Log Out"}
        </button>
      </aside>

      {/* Main Content */}
      <div className="flex-1 flex flex-col">
        {/* Navbar */}
        <header className="bg-white shadow-md p-4 flex justify-between items-center">
          <h1 className="text-lg font-semibold"></h1>
          <div className="flex items-center space-x-4">
            <BellIcon className="w-6 h-6 text-gray-600 cursor-pointer" />
            <div className="flex items-center">
              <img
                className="w-8 h-8 rounded-full border"
                src="https://via.placeholder.com/40"
                alt="User"
              />
              <span className="ml-2 font-medium">@juandelacruz</span>
            </div>
          </div>
        </header>

        {/* Main Content Area */}
        <main className="p-6 bg-gray-100 flex-1">
          <p>Dashboard content goes here...</p>
        </main>
      </div>
    </div>
  );
}
